import NavItem from './NavItem';
import {Route, Link, Routes} from 'react-router-dom';

const Nav = () => {
    return(
        <>
            <ul>

            </ul>
            <Routes>
                <Route path="/" exact element={<NavItem url={'/posts'} linkName={'Posts'}/>} />
                <Route path="/posts2"  element={<NavItem url={'/posts'} linkName={'Posts2'}/>} />
                <Route path="/posts3" exact element={<NavItem url={'/posts'} linkName={'Posts3'}/>} />
            </Routes>
        </>
    )
}


export default Nav;
